import React from 'react';

function ScoreBoard(props) {
  return (
    <div className='scores'>
      <p>{props.scoreBoard.playerName}</p>
      <p>{props.scoreBoard.numberSaved}</p>
      <p>{props.scoreBoard.totalScore}</p>
    </div>
  );
}

export default ScoreBoard;
